 @nick8756  BpB: "Menschen mit radikalen Einstellungen sind oft fanatisch, lassen die Vorstellungen anderer nicht gelten. Sie sind intolerant und beharren kompromisslos auf ihren eigenen Vorstellungen."
Duden:"eine extreme politische, ideologische, weltanschauliche Richtung vertretend [und gegen die bestehende Ordnung ankämpfend]"
"mit Rücksichtslosigkeit und Härte vorgehend, durchgeführt o. Ä."

